import logo from "./logo.svg";
import "./App.scss";
import { createTheme, ThemeProvider } from '@mui/material/styles';

import { Button } from "@mui/base";
function App() {

  const theme = createTheme({
  palette: {
    primary: '#7391a1',
    secondary: purple,
  },
});

  return (
    <div>
      <header className="App-header"></header>
      <div className="p-[4rem]">
        <div id="logo" className="flex flex-col items-center leading-10">
          <h1>NJITBytes</h1>
          <div>Healthier College Living</div>
        </div>
        <Button variant="contained">Contained</Button>
      </div>
      <div id="footer" className="h-[8rem] bg-primary w-full absolute bottom-0 flex justify-center items-center">
        <div className="text">HackNJIT 2023 - Team Phi Sig</div>
      </div>
    </div>
  );
}

export default App;
